import {
  loadChofers,
  createChofers,
  updateChoferes,
  deleteChoferes,
  clearchoferes,
} from "../../actions/choferesActions";

import service from "../../helpers/servicesAxios";

const getChoferes = () => {
  return (dispatch) => {
    let result = service.get("/choferes/").then((res) => {
      console.log("ver res result", result);
      dispatch(loadChofers(result));
    });
  };
};

const postChoferes = (value) => {
  return (dispatch) => {
    service.post("/choferes/", value).then((res) => {
      dispatch(createChofers(res));
    });
  };
};

export default { getChoferes };
